import React from 'react';
import Box from '@mui/material/Box';

const Skills = () => {
  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        width: '100vw',
        backgroundColor: 'black',
        color: 'white',
        fontSize: '2rem'
      }}
    >
      Skills
    </Box>
  );
};

export default Skills;
